import React from "react";
import "../styles/Projects.css";

const projects = [
  {
    title: "SafeCircle",
    description: "A mobile app for women's safety featuring an SOS button, fake call, incident reports, and AI-based safe route suggestions.",
    link: "#",
  },
  {
    title: "CSI Website",
    description: "Official website for the Computer Society of India (CSI) at RSET, built with modern web technologies.",
    link: "#",
  },
  {
    title: "Portfolio Website",
    description: "A personal portfolio showcasing my skills, projects, and experience in UI/UX and front-end development.",
    link: "#",
  },
];

const Projects = () => {
  return (
    <div className="projects-container">
      <h1 className="projects-heading">Projects</h1>
      <div className="projects-grid">
        {projects.map((project, index) => (
          <div key={index} className="project-card">
            <h2>{project.title}</h2>
            <p>{project.description}</p>
            <a href={project.link} target="_blank" rel="noopener noreferrer">
              View Project
            </a>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Projects;
